import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const location = useLocation();

  return (
    <nav className="navbar">
      <div className="logo">AI Fitness Trainer</div>
      <div className="nav-links">
        <Link to="/" className={location.pathname === '/' ? 'nav-link active-link' : 'nav-link'}>
          Home
        </Link>
        <Link to="/exercise" className={location.pathname === '/exercise' ? 'nav-link active-link' : 'nav-link'}>
          Exercise AI
        </Link>
        <Link to="/profile" className={location.pathname === '/profile' ? 'nav-link active-link' : 'nav-link'}>
          Profile
        </Link>
        <Link to="/settings" className={location.pathname === '/settings' ? 'nav-link active-link' : 'nav-link'}>
          Settings
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
